/**
 * Shorthand function to get a random integer in [0;a[ or [a;b[
 */
function randInt(a, b) {
  if (b && b > a) return a + Math.floor(Math.random() * (b - a));
  return Math.floor(Math.random() * a);
}

/**
 * Gets the number from [a;b] at percentage u
 */
function lerp(a, b, u) {
  if (a <= b) {
    return a + (b - a) * u;
  } else {
    return b + (a - b) * (1 - u);
  }
}

/**
 * Gets the percentage position in [a;b] of number v
 */
function unlerpUnclamped(a, b, v) {
  return (v - a) / (b - a);
}

/**
 * Gets the angle between start & end at percentage amount
 */
function lerpAngle(start, end, amount, maxDelta) {
  while (end > start + Math.PI)
    end -= Math.PI * 2;
  while (end < start - Math.PI)
    end += Math.PI * 2;
  var value;
  if (maxDelta !== undefined && Math.abs(end - start) > maxDelta) {
    value = end;
  } else {
    value = (start + ((end - start) * amount));
  }
  return (value % (Math.PI * 2));
}

/**
 * Gets the x,y coordinate between 2 points at percentage p
 */
function lerpPosition(from, to, p) {
  return {
    x: lerp(from.x, to.x, p),
    y: lerp(from.y, to.y, p)
  };
}

function lerpColor(start, end, amount) {
  var from = {
    r: (start & 0xFF0000) >> 16,
    g: (start & 0x00FF00) >> 8,
    b: (start & 0x0000FF)
  };
  var to = {
    r: (end & 0xFF0000) >> 16,
    g: (end & 0x00FF00) >> 8,
    b: (end & 0x0000FF)
  };
  var result = {
    r: lerp(from.r, to.r, amount) << 16,
    g: lerp(from.g, to.g, amount) << 8,
    b: lerp(from.b, to.b, amount)
  };
  return result.r | result.g | result.b;
}

/**
 * Gets the percentage position in [a;b] of number v, clamped into [0;1]
 */
function unlerp(a, b, v) {
  return Math.min(1, Math.max(0, unlerpUnclamped(a, b, v)));
}

/**
 * Constant for physics values
 */
var PER_SEC = 1 / 1000;

var Drawer = function () {
  this.messages = 0;
  this.debugMode = false;
  this.toDestroy = [];
};

var inhibTextureDestroy = function () {
  if (this.baseTexture) {
    this.baseTexture.dispose();
    /* pixi hack */
    this.baseTexture.removeAllListeners('dispose');
  }

  if (this.textureBuffer) {
    this.textureBuffer.destroy();
    this.textureBuffer = null;
  }

  if (this.filterManager) {
    this.filterManager.destroy();
    this.filterManager = null;
  }
  if (this.renderer) {
    this.renderer = null;
  }

};

Drawer.prototype.showMyMessages = function () {
  return this.messages === 0 || this.messages == 1;
};

Drawer.prototype.showOthersMessages = function () {
  return this.messages === 0;
};
Drawer.requirements = {
  PIXI: 'PIXI4'
};
Drawer.VERSION = 2;
Drawer.WIDTH = 1920;
Drawer.HEIGHT = 1080;
Drawer.CENTER = {
  x: 0.5,
  y: 0.5,
};

Drawer.prototype.destroy = function () {
  if (this.alreadyLoaded) {
    this.renderer.destroy();
    this.endCallback = null;
  }
  this.destroyed = true;
};

Drawer.prototype.destroyScene = function (scope) {
  for (var i = 0, l = this.toDestroy.length; i < l; ++i) {
    var texture = this.toDestroy[i];
    texture.destroy(true);
  }
  this.toDestroy = [];
};

/** Mandatory */
Drawer.prototype.getGameName = function () {
  return "Roche";
};

Drawer.getDefaultOverSampling = function () {
  return 2;
};

Drawer.getGameRatio = function () {
  return Drawer.WIDTH / Drawer.HEIGHT;
};


Drawer.prototype.canSwapPlayers = function () {
  return true;
};

/** Mandatory */
Drawer.prototype.getResources = function () {
  var url = 'https://cdn-games.codingame.com/roche/';
  // var url = 'http://localhost/CodeRings/roche/';
  return {
    baseUrl: url,
    images: {
      FOND_100: 'FOND_100.png',
      background: 'background.jpg',
    },
    spines: {},
    sprites: ['anim_prod.json', 'diagnosis_anim.json', 'samples_machine.json', 'pc.json', 'sprites.json'],
    fonts: ['04b.fnt', 'health_font2.fnt'],
    others: []
  };
};

Drawer.prototype.getOptions = function () {
  var drawer = this;
  return [{
    get: function () {
      return drawer.debugMode;
    },
    set: function (value) {
      drawer.debugMode = value;
      drawer.setDebug(value);
    },
    title: 'DEBUG MODE',
    values: {
      'ON': true,
      'OFF': false
    }
  }, {
    get: function () {
      return drawer.messages;
    },
    set: function (value) {
      drawer.messages = value;
      drawer.asyncRenderingTime = Drawer.RenderTimeout;
    },
    title: 'MESSAGES',
    values: {
      ALL: 0,
      MINE: 1,
      NONE: 2
    }
  }];
};

Drawer.prototype.getBackground = function () {
  return 0x1f1d2f;
};

Drawer.prototype.setDebug = function (v) {
  this.asyncRenderingTime = Drawer.RenderTimeout;
};

/** Mandatory */
Drawer.prototype.initPreload = function (scope, container, progress, canvasWidth, canvasHeight) {
  scope.canvasWidth = canvasWidth;
  scope.canvasHeight = canvasHeight;

  scope.loaderProgress = new PIXI.Text('100', {
    fontSize: (canvasHeight * 0.117),
    fontFamily: 'Lato',
    fontWeight: '900',
    fill: 'white',
    align: 'center'
  });

  scope.loaderProgress.anchor.y = 1;
  scope.loaderProgress.anchor.x = 1.3;
  scope.progress = scope.realProgress = progress;
  scope.loaderProgress.position.y = canvasHeight;

  scope.progressBar = new PIXI.Graphics();
  container.addChild(scope.progressBar);
  container.addChild(scope.loaderProgress);
};

/** Mandatory */
Drawer.prototype.preload = function (scope, container, progress, canvasWidth, canvasHeight, obj) {
  scope.progress = progress;
};

/** Mandatory */
Drawer.prototype.renderPreloadScene = function (scope, step) {
  var stepFactor = Math.pow(0.998, step);
  scope.realProgress = stepFactor * scope.realProgress + (1 - stepFactor) * scope.progress;
  scope.loaderProgress.text = ((scope.realProgress * 100).toFixed(0));
  scope.loaderProgress.position.x = scope.realProgress * scope.canvasWidth;

  scope.progressBar.clear();

  scope.progressBar.beginFill(0x0, 1);
  scope.progressBar.drawRect(0, 0, scope.canvasWidth * scope.realProgress + 1, scope.canvasHeight);
  scope.progressBar.endFill();

  scope.progressBar.beginFill(0x3f4446, 1);
  scope.progressBar.drawRect(scope.canvasWidth * scope.realProgress, 0, scope.canvasWidth, scope.canvasHeight);
  scope.progressBar.endFill();
  return true;
};

/** Mandatory */
Drawer.prototype.initDefaultScene = function (scope, container, canvasWidth, canvasHeight) {
  var scene = new Drawer.PIXI.Container();

  var logo = Drawer.PIXI.Sprite.fromFrame('LOGO_ROCHE_WHITE_SHADOW');
  logo.anchor.x = logo.anchor.y = 0.5;
  logo.x = Drawer.WIDTH / 2;
  logo.y = Drawer.HEIGHT / 2;
  scope.logo = logo;

  scene.scale.x = canvasWidth / 1920;
  scene.scale.y = canvasHeight / 1080;
  scene.addChild(logo);

  var demoContainer = new Drawer.PIXI.Container();

  this.initDefaultFrames(Drawer.DEMO.playerCount, Drawer.DEMO.frames, Drawer.DEMO.agents);
  /** **************************************************************************************************************************************** */
  this.preconstructScene(this.initData, this.scope, demoContainer, this.initWidth, this.initHeight);
  this.initScene(this.scope, demoContainer, this.frames, true);
  this.updateScene(this.scope, this.question, this.frames, this.currentFrame, this.progress, 1, this.reasons[this.currentFrame], true);
  /** **************************************************************************************************************************************** */
  this.currentFrame = -1;
  container.addChild(demoContainer);
  container.addChild(scene);

  scope.demo = demoContainer;
  scope.demotime = 0;
  scope.updateTime = 0;
  scope.frameTime = 0;
};

Drawer.prototype.initDefaultFrames = function (playerCount, frames, agents) {
  var drawer = this;
  var loader = new Drawer.PIXI.loaders.Loader(window.location.origin);

  this.playerInfo = agents.map(function (agent, index) {
    var agentData = {
      name: agent.name || 'Anonymous',
      color: drawer.parseColor(agent.color),
      number: index,
      index: agent.index,
      type: agent.type,
      isMe: agent.type === 'CODINGAMER' && agent.typeData.me
    };

    return agentData;
  });

  var firstFrame = frames[0];
  this._frames = frames;
  this.playerCount = playerCount;
  this.reasons = [];
  this.frames = [];

  this.frames.push(this.parseFrame(this.handleInitFrame(firstFrame), true, this.frames, this.initData, this.playerCount));
  for (var i = 1; i < this._frames.length; ++i) {
    var temp = this._frames[i];
    var header = temp[0].split(" ");
    if (header.length > 2) {
      this.reasons[i] = header[2];
    }
    this.frames.push(this.parseFrame(temp.slice(1, -1), header[0] == 'KEY_FRAME', this.frames, this.initData, this.playerCount));
  }
  this.asyncRenderingTime = Drawer.RenderTimeout;

};

/** Mandatory */
Drawer.prototype.renderDefaultScene = function (scope, step) {
  step = Math.min(80, step);

  this.currentFrame = this.currentFrameTemp || 0;

  scope.frameTime += step;
  scope.updateTime += step;
  scope.demotime += step / 1000;

  var animProgress = Math.max(0, Math.min(1, (scope.demotime - 1) / 0.5));
  scope.logo.alpha = animProgress;
  scope.logo.scale.x = scope.logo.scale.y = 3 - animProgress * 2;

  if (scope.demotime > 1.5 && scope.demotime <= 2.2) {
    var amplitude = Math.max(0, 1 - (scope.demotime - 1.5) / 0.7) * 15;
    amplitude = 0;

    scope.shakeZone.x = (Math.random() * 2 - 1) * amplitude;
    scope.shakeZone.y = (Math.random() * 2 - 1) * amplitude;
  } else {
    scope.shakeZone.x = scope.shakeZone.y = 0;
  }
  var updateInterval = 30;
  var frameInterval = 480;

  if (scope.updateTime >= updateInterval) {
    scope.updateTime -= updateInterval;
    this.progress = unlerp(0, frameInterval, scope.frameTime);
    this.updateScene(this.scope, this.question, this.frames, this.currentFrame, this.progress, 1, this.reasons[this.currentFrame], true);
  }

  if (scope.frameTime >= frameInterval) {
    scope.frameTime -= frameInterval;
    this.currentFrame = (this.currentFrame + 2) % this.frames.length;
  }
  this.renderScene(this.scope, this.question, this.frames, this.currentFrame, this.progress, 1, this.reasons[this.currentFrame], step, true);

  this.currentFrameTemp = this.currentFrame;
  this.currentFrame = -1;
  return true;
};

Drawer.prototype.endDefaultScene = function (scope, step) {
  return true;
};

Drawer.prototype.parsePos = function (str) {
  var raw = str.split(' ');
  return {
    x: +raw[0],
    y: +raw[1]
  };
};

/** Mandatory */
Drawer.prototype.parseInitData = function (question, lines, playerCount) {
  var i;
  var line = 1;
  var constants = lines[line++].split(' ');

  var projectCount = +lines[line++];
  var projects = [];
  var toInt = function (v) {
    return +v;
  };
  for (i = 0; i < projectCount; ++i) {
    projects.push(lines[line++].split(' ').map(toInt));
  }

  var samples = [];
  var sampleCount = +lines[line++];
  for (i = 0; i < sampleCount; i++) {
    var raw = lines[line++].split(' ');
    var sample = {
      id: +raw[0],
      cost: [+raw[1], +raw[2], +raw[3], +raw[4], +raw[5]],
      rank: +raw[6],
      life: +raw[7],
      gain: raw[8]
    };
    samples.push(sample);
  }

  return {
    width: 1920,
    height: 1080,
    projectValue: +constants[0],
    leagueLevel: +constants[1],
    projects: projects,
    playerCount: playerCount,
    map: {
      "START_POS": {
        "0": {
          "x": 876,
          "y": 602
        },
        "1": {
          "x": 1044,
          "y": 602
        }
      },
      "MOLECULES": {
        "0": {
          "x": 876,
          "y": 813
        },
        "1": {
          "x": 1044,
          "y": 813
        },
        "source": {
          "x": 946,
          "y": 856
        }
      },
      "SAMPLES": {
        "0": {
          "x": 876,
          "y": 395
        },
        "1": {
          "x": 1044,
          "y": 395
        },
        "source": {
          "x": 975,
          "y": 195
        }
      },
      "DIAGNOSIS": {
        "0": {
          "x": 466,
          "y": 600
        },
        "1": {
          "x": 446,
          "y": 714
        }
      },
      "LABORATORY": {
        "0": {
          "x": 1444,
          "y": 525
        },
        "1": {
          "x": 1444,
          "y": 718
        },
        "source": {
          "x": 1660,
          "y": 567
        }
      }
    },
    samples: samples,
    keyframes: []
  };
};

/** Mandatory */
Drawer.prototype.getInitLineCount = function (frame) {
  return +frame[0];
};

var EV_NEW_SAMPLE = 0;
var EV_TAKE_SAMPLE = 1;
var EV_STORE_SAMPLE = 2;
var EV_TAKE_MOLECULE = 3;
var EV_DIAGNOSE = 4;
var EV_PRODUCE = 5;
var EV_INITIAL_STOCK_SAMPLE = 6;

Drawer.prototype.removeFromAll = function (players, sampleId) {
  for (var p = 0; p < players.length; ++p) {
    idx = players[p].carrying.indexOf(sampleId);
    if (idx >= 0) {
      players[p].carrying.splice(idx, 1);
    }
  }
};

/** Mandatory */
Drawer.prototype.parseFrame = function (lines, keyFrame, previousFrames, initData) {
  var i, p, idx, k;
  var frame = {};
  frame.previous = previousFrames[previousFrames.length - 1] || frame;
  if (!keyFrame) {
    return frame.previous;
  }
  frame.number = previousFrames.length;

  var line = 0;
  var players = [];

  for (i = 0; i < initData.playerCount; ++i) {
    var playerLine = lines[line++];
    var playerRaw = playerLine.split(' ');
    var player = {
      target: {},
      storage: [],
      expertise: []
    };
    var n = 0;

    player.target = playerRaw[n++];
    player.from = playerRaw[n++];
    player.eta = +playerRaw[n++];
    player.moved = +playerRaw[n++];
    player.total = +playerRaw[n++];
    player.storage[0] = +playerRaw[n++];
    player.storage[1] = +playerRaw[n++];
    player.storage[2] = +playerRaw[n++];
    player.storage[3] = +playerRaw[n++];
    player.storage[4] = +playerRaw[n++];
    player.expertise[0] = +playerRaw[n++];
    player.expertise[1] = +playerRaw[n++];
    player.expertise[2] = +playerRaw[n++];
    player.expertise[3] = +playerRaw[n++];
    player.expertise[4] = +playerRaw[n++];
    player.score = +playerRaw[n++];
    player.dead = +playerRaw[n++];
    player.message = playerLine.split(';')[1];

    player.carrying = [];

    players.push(player);

    if (frame.previous.players) {
      for (k = 0; k < frame.previous.players[i].carrying.length; ++k) {
        player.carrying.push(frame.previous.players[i].carrying[k]);
      }
    }
  }

  var event, sample;
  var events = [];
  var storedSamples = [];
  if (previousFrames.length === 0) {
    for (k = 0; k < initData.samples.length; ++k) {
      event = {
        id: EV_INITIAL_STOCK_SAMPLE,
        sample: initData.samples[k]
      };
      events.push(event);
      storedSamples.push(initData.samples[k].id);
    }
  } else if (frame.previous.storedSamples) {
    for (k = 0; k < frame.previous.storedSamples.length; ++k) {
      storedSamples.push(frame.previous.storedSamples[k]);
    }
  }

  var moleculesRaw = lines[line++].split(' ');
  var molecules = [+moleculesRaw[0], +moleculesRaw[1], +moleculesRaw[2], +moleculesRaw[3], +moleculesRaw[4]];

  var eventCount = +lines[line++];
  for (i = 0; i < eventCount; ++i) {
    var eventRaw = lines[line++].split(' ');
    event = {
      id: +eventRaw[0]
    };

    if (event.id === EV_NEW_SAMPLE) {
      sample = {
        id: +eventRaw[1],
        cost: [+eventRaw[2], +eventRaw[3], +eventRaw[4], +eventRaw[5], +eventRaw[6]],
        rank: +eventRaw[7],
        life: +eventRaw[8],
        gain: eventRaw[9]
      };
      event.sample = sample;
      event.player = +eventRaw[10];
      initData.samples.push(sample);

      players[event.player].carrying.push(sample.id);

    } else if (event.id == EV_DIAGNOSE) {
      event.sample = initData.samples[+eventRaw[1]];
    } else if (event.id == EV_PRODUCE) {
      event.sample = initData.samples[+eventRaw[1]];

      this.removeFromAll(players, event.sample.id);
    } else if (event.id == EV_TAKE_MOLECULE) {
      event.moleculeType = eventRaw[1];
      event.player = +eventRaw[2];
    } else if (event.id == EV_TAKE_SAMPLE) {
      event.sample = initData.samples[+eventRaw[1]];
      event.player = +eventRaw[2];

      idx = storedSamples.indexOf(event.sample.id);
      if (idx >= 0) {
        storedSamples.splice(idx, 1);
      }

      players[event.player].carrying.push(event.sample.id);
    } else if (event.id == EV_STORE_SAMPLE) {
      event.sample = initData.samples[+eventRaw[1]];
      event.player = +eventRaw[2];

      storedSamples.push(event.sample.id);
      this.removeFromAll(players, event.sample.id);
    } else if (event.id == EV_INITIAL_STOCK_SAMPLE) {
      sample = {
        id: +eventRaw[1],
        cost: [+eventRaw[2], +eventRaw[3], +eventRaw[4], +eventRaw[5], +eventRaw[6]],
        rank: +eventRaw[7],
        life: +eventRaw[8],
        gain: eventRaw[9]
      };
      //previousFrames.events.push(event);
      event.sample = sample;
      initData.samples.push(sample);
    }

    events.push(event);
  }

  frame.players = players;
  frame.molecules = molecules;
  frame.events = events;
  frame.storedSamples = storedSamples;
  initData.keyframes.push(frame);

  return frame;
};

/**
 * Adds pixi instance 'child' to pixi instance 'container' as a display child and as a property named 'property'
 * 
 * @returns the child instance
 */
Drawer.prototype.sub = function (container, property, child, at) {
  container[property] = child;
  if (isNaN(at)) {
    container.addChild(child);
  } else {
    container.addChildAt(child, at);
  }

  return child;
};

/**
 * Returns the scale needed to fit (srcWidth, srcHeight) inside (maxWidth, maxHeight)
 */
Drawer.prototype.fitAspectRatio = function (srcWidth, srcHeight, maxWidth, maxHeight, padding) {
  padding = padding || 0;
  return Math.min(maxWidth / (srcWidth + padding), maxHeight / (srcHeight + padding));
};

/**
 * Interacts with the developer window. For debug purposes.
 */
Drawer.prototype.customAction = function (param) {
  var scope = this.scope;
  var d = scope.drawer;
  var width = lerp(0, 1920, param);
  var height = lerp(0, 1080, param);
  var ratio = Math.min(960 / width, 540 / height);
  var canvas = document.getElementsByTagName('canvas')[0];
  canvas.width = width;
  canvas.height = height;
  canvas.style.width = width + "px";
  canvas.style.height = height + "px";
  this.init(canvas, width, height, null, 1);

  return param;
};

Drawer.prototype.preconstructScene = function (initData, scope, container, canvasWidth, canvasHeight) {
  scope.canvasHeight = canvasHeight;
  scope.canvasWidth = canvasWidth;

  scope.renderables = [];

  scope.time = 0;
  scope.endTime = 0;

  scope.initData = initData;
  scope.playerInfo = this.playerInfo;
  for (var i = 0; i < 2; ++i) {
    if (scope.playerInfo[i].index === 0) {
      scope.playerInfo[i].color = 0xffc414;
    }
  }

  container.scale.x = canvasWidth / Drawer.WIDTH;
  container.scale.y = canvasHeight / Drawer.HEIGHT;

  scope.toPixel = (1 / container.scale.x) * (this.oversampling || 1);
  scope.gameToView = Drawer.WIDTH / scope.initData.width;
};

Drawer.prototype.createGameZone = function (scope) {
  var gameZone = scope.gameZone = new PIXI.Container();
  this.scale(gameZone, scope.gameZoneScale);
  gameZone.x = Drawer.WIDTH / 2 - (scope.initData.width * scope.gameZoneScale) / 2;
  gameZone.y = Drawer.HEIGHT / 2 - (scope.initData.height * scope.gameZoneScale) / 2;
  return gameZone;
};

Drawer.prototype.createMolecule = function (index, borderColor, scope, size) {
  var moleculeColors = [0xffc414, 0x009966, 0x7474ba, 0xcc0033, 0x0066cc];
  var textColors = [0x47210a, 0xc2ffeb, 0xebebff, 0xffe6ec, 0xddeeff];

  var molecule = new PIXI.Container();
  var g = new PIXI.Graphics();
  g.lineStyle(2 * scope.toPixel, borderColor, 1);
  g.beginFill(moleculeColors[index], 1);
  g.drawCircle(0, 0, size || 19.2);
  g.endFill();
  var num = this.generateText('0', (size - 2.4) || 16.8, 'center', textColors[index]);
  num.anchor.y = 0.5;
  molecule.num = num;
  molecule.addChild(g);
  molecule.addChild(num);
  return molecule;
};

Drawer.prototype.createHUD = function (scope) {
  var layer = new PIXI.Container();
  scope.huds = [];
  for (var idx = 0; idx < scope.initData.playerCount; ++idx) {
    var hud = new PIXI.Container();
    var i = scope.playerInfo[idx].index;

    var background = this.sub(hud, 'background', new PIXI.Sprite.fromFrame('FOND_100'));
    this.scale(background, 1.2);
    background.alpha = 0.5;
    background.scale.x = i === 0 ? 1 : -1;
    background.anchor.y = i === 0 ? 0 : 1;

    var face = this.sub(hud, 'face', new PIXI.Container());
    var mask = new PIXI.Graphics();
    face.addChild(mask);
    mask.beginFill(0xFF0000, 1);
    mask.moveTo(37, 93);
    mask.lineTo(98, 31);
    mask.lineTo(183, 31);
    mask.lineTo(183, 157);
    mask.lineTo(98, 157);
    mask.endFill();
    if (i === 0) {
      this.scale(mask, 1);
    } else {
      this.scale(mask, -1);
    }

    var avatar = this.sub(face, 'avatar', new PIXI.Sprite(scope.playerInfo[idx].avatar));

    avatar.width = avatar.height = 130;
    avatar.x = 46;
    avatar.y = 28;
    if (i === 1) {
      avatar.x = -175;
      avatar.y = -156;
    }
    avatar.mask = mask;

    var frame = this.sub(hud, 'frame', new PIXI.Sprite.fromFrame('avatar_P' + (i + 1)));
    frame.x = i === 0 ? 26 : -188;
    frame.y = i === 0 ? 23 : -162;
    this.scale(frame, 1.2);

