Drawer.renderSample = function (step, scope) {
  var freq = 1 / 290;
  var ampl = 4;

  if (!this.time & this.time !== 0) {
    this.time = Math.random() * ((Math.PI * 2) / freq);
  }
  this.time += step;

  if (this.currentState && this.currentState.id !== STATE_DIAGNOSE) {
    this.discovered.y = Math.cos(this.time * freq) * ampl;
    this.undiscovered.y = Math.cos(this.time * freq) * ampl;
  }
};

