  scope.samples = [];

  for (i = 0; i < scope.initData.samples.length; ++i) {
    var sampleData = scope.initData.samples[i];
    var sample = new PIXI.Container();
    var discovered = this.sub(sample, 'discovered', PIXI.Sprite.fromFrame(['FORMULAR_GREEN2', 'FORMULAR_YELLOW', 'FORMULAR_RED'][sampleData.rank]));
    var undiscovered = this.sub(sample, 'undiscovered', PIXI.Sprite.fromFrame(['TUBE_GREEN2', 'TUBE_YELLOW', 'TUBE_RED'][sampleData.rank]));

    var text = this.getTooltipText(sampleData, scope);
    if (!demo) {
      sample.interactive = true;
      sample.mouseover = getMouseOverFunc(scope, sampleData, text);
      sample.mouseout = getMouseOutFunc(scope, sampleData);
      sample.mousemove = getMouseMoveFunc(scope, sampleData);
    }
    sample.transitions = {};
    sample.state = {};
    sample.id = i;
    this.anchor(sample.discovered, Drawer.CENTER);
    this.anchor(sample.undiscovered, Drawer.CENTER);

    sample.render = Drawer.renderSample;
    scope.renderables.push(sample);

    this.scale(sample.undiscovered, 0.8);
    this.scale(sample.discovered, 0.5);
    scope.samples.push(sample);
    layer.addChild(sample);

  }

  for (i = 0; i < frames.length; ++i) {
    var frame = frames[i];
    for (var k = 0; k < frame.events.length; ++k) {
      var event = frame.events[k];
      if (!event.sample)
        continue;
      var s = scope.samples[event.sample.id];
      if (event.id == EV_NEW_SAMPLE) {
        s.transitions[frame.number] = {
          id: STATE_SPAWN,
          player: event.player
        };
      } else if (event.id == EV_TAKE_SAMPLE) {
        s.transitions[frame.number] = {
          id: STATE_FROM_STORAGE,
          player: event.player
        };
      } else if (event.id == EV_PRODUCE) {
        s.transitions[frame.number] = {
          id: STATE_PRODUCE
        };
      } else if (event.id == EV_DIAGNOSE) {
        s.transitions[frame.number] = {
          id: STATE_DIAGNOSE,
          discovered: true
        };
      } else if (event.id == EV_STORE_SAMPLE) {
        s.transitions[frame.number] = {
          id: STATE_TO_STORAGE
        };
      } else if (event.id == EV_INITIAL_STOCK_SAMPLE) {
        s.transitions[0] = {
          id: STATE_INITIAL_STOCK,
          discovered: true
        };
      }
    }
  }

  return {
    layer: layer
  };
};

Drawer.transitionToState = {};
Drawer.transitionToState[STATE_INITIAL_STOCK] = STATE_STORED;
Drawer.transitionToState[STATE_STORED] = STATE_STORED;
Drawer.transitionToState[STATE_CARRIED] = STATE_CARRIED;
