Drawer.transitionToState[STATE_PRODUCE] = null;

Drawer.prototype.getStateOfSample = function (sample, frame) {
  frame = this.frames[frame].number;
  if (sample.state[frame] !== undefined) {
    return sample.state[frame];
  }

  var transitions = Object.keys(sample.transitions);
  var previous = null;
  var previousPlayer = null;
  var state = null;
  var discovered = false;

  for (var i = 0; i < transitions.length; ++i) {
    if (transitions[i] <= frame) {
      previous = sample.transitions[transitions[i]];
      if (previous.hasOwnProperty('player')) {
        previousPlayer = previous.player;
      }
      if (previous.discovered) {
        discovered = true;
      }
    }
    if (transitions[i] == frame) {
      state = {
        id: previous.id,
        player: previousPlayer,
        discovered: previous.discovered || discovered
      };
      break;
    }
    if (transitions[i] > frame) {
      break;
    }
  }

  if (previous && !state) {
    state = {
      id: Drawer.transitionToState[previous.id],
      player: previousPlayer,
      discovered: discovered
    };
  }

  if (!state || state.id === null) {
    sample.state[frame] = null;
    return null;
  } else {
    sample.state[frame] = state;
    return state;
  }
};

