Drawer.prototype.anchor = function (obj, anchor) {
  obj.anchor.x = anchor.x;
  obj.anchor.y = anchor.y;
};

Drawer.prototype.scale = function (obj, scale) {
  obj.scale.x = scale;
  obj.scale.y = scale;
};

/**
 * A few transition functions contained within [0,1] on both axes
 */
Drawer.BELL = function (x) {
  return 1 - Math.pow((x - 0.5) * 2, 2);
};
Drawer.ELASTIC = function (t) {
  return (0.04 - 0.04 / (t / 4)) * Math.sin(25 * t / 4) + 1;
};
Drawer.SNAP = function (t) {
  var b = 0, c = 1, d = 1;
  var s = 1.70158;
  var p = 0;
  var a = c;
  if (t === 0) return b;
  if ((t /= d) == 1) return b + c;
  if (!p) p = d * 0.3;
  if (a < Math.abs(c)) {
    a = c;
    s = p / 4;
  } else s = p / (2 * Math.PI) * Math.asin(c / a);
  return a * Math.pow(2, -10 * t) * Math.sin((t * d - s) * (2 * Math.PI) / p) + c + b;
};
Drawer.EASE = function (t) {
  return t < 0.5 ? 2 * t * t : -1 + (4 - 2 * t) * t;
};

/** Mandatory */
Drawer.prototype.updateScene = function (scope, question, frames, frameNumber, progress, speed, reason, demo) {
  /** ************************************* */
  /*        SYNCHRONOUS                     */
  /** ************************************* */
  if (speed === 0 && progress === 1 && frameNumber < frames.length - 1) {
    progress = 0.85;
  }
  var frame = frames[frameNumber];
  scope.currentFrame = frame;
  scope.currentProgress = progress;
  scope.reason = reason;

  this.updatePlayers(frameNumber, progress, frame, scope);
  this.updateSamples(frameNumber, progress, frame, scope);
  !demo && this.updateHUD(frameNumber, progress, frame, scope);
  this.updateStock(frameNumber, progress, frame, scope);
  this.updateMolecules(frameNumber, progress, frame, scope);
  if (scope.initData.leagueLevel > 1) {
    this.updateProductions(frameNumber, progress, frame, scope);
  }
  if (!demo) {
    this.updateMessages(frameNumber, progress, frame, scope);
  }
  this.updateMachines(frameNumber, progress, frame, scope);
};

Drawer.prototype.updateMachines = function (frame, progress, data, scope) {
  var play = {};
  for (var i = 0; i < data.events.length; ++i) {
    var ev = data.events[i];
    if (ev.id == EV_DIAGNOSE) {
      play.diagnosis = true;
    } else if (ev.id == EV_PRODUCE) {
      play.lab = true;
    } else if (ev.id == EV_NEW_SAMPLE) {
      play.samples = true;
    } else if (ev.id == EV_STORE_SAMPLE || ev.id == EV_TAKE_SAMPLE) {
      if (scope.playerInfo[ev.player].index === 0) {
        play.yellowPC = true;
      } else {
        play.redPC = true;
      }
    }
  }
  for (var key in scope.machines) {
    if (play[key]) {
      scope.machines[key].loop = true;
      scope.machines[key].play();
    } else if (scope.machines[key].playing) {
      if (scope.machines[key].loop) {
        var cf = scope.machines[key].currentFrame;
        scope.machines[key].loop = false;
        scope.machines[key].gotoAndPlay(cf);
      }
    } else {
      scope.machines[key].gotoAndStop(0);
    }
  }



};

Drawer.prototype.updateMessages = function (frame, progress, data, scope) {
  for (var i = 0, l = scope.messages.length; i < l; ++i) {
    var message = scope.messages[i];

    var pos = this.getPlayerPosition(data, message.player, scope, progress);
    message.x = pos.x + scope.messageBox.offset.x;
    message.y = pos.y + scope.messageBox.offset.y;
    var minPad = 10;
    var scale = {
      x: (message.messageText.width + minPad) / scope.messageBox.width,
      y: (message.messageText.height + minPad) / 80
    };

    message.messageBackground.scale.x = Math.max(1, scale.x);
    message.messageBackground.scale.y = Math.max(1, scale.y);

    var text = data.players[message.player].message;
    if (text) {
      message.visible = true;
      message.messageText.text = text;
    } else {
      message.visible = false;
    }
  }
};

Drawer.prototype.updateProductions = function (frame, progress, data, scope) {
  for (var k = 0; k < scope.lives.length; ++k) {
    scope.lives[k].visible = false;
  }

  for (var i = 0; i < scope.productions.length; ++i) {
    var production = scope.productions[i];
    if (production.frame != frame) {
      production.visible = false;
    } else {
      production.visible = true;

      // Animate score
      var from = {
        x: scope.initData.map.LABORATORY.source.x,
        y: scope.initData.map.LABORATORY.source.y - 270
      };

      var to = {
        x: scope.initData.map.LABORATORY.source.x,
        y: scope.initData.map.LABORATORY.source.y - 340
      };
      var newPos = lerpPosition(from, to, Drawer.EASE(progress));

      production.life.x = newPos.x + 50;
      production.life.y = newPos.y;
      production.life.visible = true;
      production.life.text = '+' + production.sample.life + ' HEALTH';

      // Animate letters
      from = {
        x: scope.initData.map.LABORATORY.source.x + 60,
        y: scope.initData.map.LABORATORY.source.y
      };

      var through = {
        x: scope.initData.map.LABORATORY.source.x + 60,
        y: scope.initData.map.MOLECULES.source.y + 60
      }

      to = {
        x: scope.initData.map.MOLECULES.source.x,
        y: scope.initData.map.MOLECULES.source.y + 60
      };

      var moleculeDelay = 0.075;

      var n = production.sprites.length;
      var easeP = Drawer.EASE(unlerp(0.4, 1, progress));
      for (var k = 0; k < n; ++k) {
        var mol = production.sprites[k];
        var start = k * moleculeDelay;
        var stop = 1 - (n - 1 - k) * moleculeDelay;
        var moveP = unlerp(start, stop, easeP);

        if (moveP <= 0.5) {
          newPos = lerpPosition(from, through, unlerp(0, 0.5, moveP));
        } else {
          newPos = lerpPosition(through, to, unlerp(0.5, 1, moveP))
        }
        mol.x = newPos.x;
        mol.y = newPos.y;
        mol.alpha = unlerp(start, start + moleculeDelay, moveP);
      }
    }

  }
};

Drawer.prototype.updateHUD = function (frame, progress, data, scope) {

  for (var i = 0; i < scope.huds.length; ++i) {
    var hud = scope.huds[i];
    var player = data.players[i];
    hud.labels.score.text = player.score.toString();

    for (var k = 0; k < 5; ++k) {
      for (var j = 0; j < (scope.initData.leagueLevel > 1 ? 2 : 1); ++j) {
        var key = ['storage', 'expertise'][j];
        var amount = player[key][k];
        var ball = hud[key][k];

        ball.num.text = amount.toString();
        ball.alpha = (amount > 0) ? 1 : 0.35;
        ball.num.visible = (amount > 0);
      }
    }
  }
};

Drawer.prototype.updateStock = function (frame, progress, data, scope) {
  var stock = [];
  for (var j = 0; j < data.molecules.length; ++j) {
    stock.push(data.molecules[j]);
  }

  if (progress < 0.98) {
    for (var k = 0; k < data.events.length; ++k) {
      var ev = data.events[k];
      if (ev.id == EV_PRODUCE) {
        var expertise = data.players[this.getStateOfSample(scope.samples[ev.sample.id], frame).player].expertise;

        for (var n = 0; n < 5; ++n) {
          stock[n] -= Math.max(0, ev.sample.cost[n] - expertise[n]);
        }
      }
    }
  }

  for (var i = 0; i < 5; ++i) {
    var ball = scope.stock[i];
    var amount = stock[i];
    if (scope.initData.leagueLevel > 1) {
      ball.num.text = amount.toString();
      ball.num.visible = (amount > 0);
    } else {
      ball.num.visible = true;
      ball.num.text = ABCDE.charAt(i);
    }

  }
};

Drawer.prototype.resourceArrayToString = function (arr) {
  var str = '';
  var k;

  if (arr.reduce(function (a, b) {
    return a + b;
  }) < 6) {
    for (k = 0; k < arr.length; ++k) {
      for (var i = 0; i < arr[k]; ++i) {
        str += ABCDE.charAt(k);
      }
    }
  } else {
    for (k = 0; k < arr.length; ++k) {
      if (arr[k] > 0) {
        str += arr[k] + ABCDE.charAt(k) + ' ';
      }
    }
  }

  return str.trim();
};

Drawer.prototype.updateMolecules = function (frame, progress, data, scope) {
  var i, res;

  for (i = 0; i < scope.molecules.length; ++i) {
    res = scope.molecules[i];
    res.visible = false;
  }

  for (i = 0; i < data.events.length; ++i) {
    var ev = data.events[i];
    if (ev.id == EV_TAKE_MOLECULE) {
      res = scope.moleculeMap[ev.player][ev.moleculeType];
      res.visible = true;
      var source = scope.stockPosition;
      var pod = scope.moleculePods[ABCDE.indexOf(ev.moleculeType)];
      var from = {
        x: source.x + pod.x,
        y: source.y + pod.y
      };
      var to = this.getPlayerPosition(data, ev.player, scope, progress);
      to = {
        x: to.x,
        y: to.y + scope.playerTrayOffset
      };

      var scale = 0.001 + Drawer.BELL(progress) * 2.499;
      var newPos = lerpPosition(from, to, progress);
      this.scale(res, scale);

      res.x = newPos.x;
      res.y = newPos.y;
    }

  }
};

Drawer.prototype.getSampleOffset = function (sample, data, state, scope) {
  if (state.player === null) {
    return {
      x: 0,
      y: 0
    };
  }
  var carrying = data.players[state.player].carrying;
  var carryIndex = carrying.indexOf(sample.id);
  var carryTotal = carrying.length - 1;
  if (carryIndex == -1) {
    return {
      x: 0,
      y: 0
    };
  }
  return scope.sampleOffset[carryTotal][carryIndex];
};

Drawer.prototype.updateSamples = function (frame, progress, data, scope) {
  var map = scope.initData.map;
  var from, to, newPos, pos, idx, xAnim, fadeP, pc;
  for (var i = 0; i < scope.samples.length; ++i) {
    var sample = scope.samples[i];
    var state = this.getStateOfSample(sample, frame);
    sample.alpha = 1;
    sample.rotation = 0;
    sample.currentState = state;

    if (!state) {
      sample.visible = false;
    } else {
      sample.visible = true;
      sample.undiscovered.alpha = state.discovered ? 0 : 1;
      sample.discovered.alpha = state.discovered ? 1 : 0;


      var offset = this.getSampleOffset(sample, data, state, scope);
      var prevOffset = this.getSampleOffset(sample, data.previous, state, scope);
      offset = offset || {
        x: -100,
        y: -100
      };
      prevOffset = prevOffset || offset;

      if (state.id == STATE_INITIAL_STOCK) {
        idx = data.storedSamples.indexOf(sample.id);
        sample.alpha = 0;
      } else if (state.id == STATE_CARRIED) {
        pos = this.getPlayerPosition(data, state.player, scope, progress);

        newPos = lerpPosition({
          x: pos.x + prevOffset.x,
          y: pos.y + prevOffset.y
        }, {
            x: pos.x + offset.x,
            y: pos.y + offset.y
          }, progress);
        sample.x = newPos.x * scope.gameToView;
        sample.y = newPos.y * scope.gameToView;

      } else if (state.id == STATE_SPAWN) {
        fadeP = progress;
        var transferP = unlerp(0.5, 1, progress);
        pos = this.getPlayerPosition(data, state.player, scope, progress);
        from = {
          x: map.SAMPLES.source.x,
          y: map.SAMPLES.source.y - 40
        };
        to = {
          x: pos.x + offset.x,
          y: pos.y + offset.y
        };
        newPos = lerpPosition(from, to, Drawer.ELASTIC(transferP));
        sample.alpha = fadeP;

        sample.x = newPos.x;
        sample.y = newPos.y;
      } else if (state.id == STATE_DIAGNOSE) {

        var playerPos = this.getPlayerPosition(data, state.player, scope, progress);
        idx = data.storedSamples.indexOf(sample.id);

        pos = {
          x: playerPos.x + offset.x,
          y: playerPos.y + offset.y
        };

        xAnim = -100 * Drawer.BELL(progress);
        var rotation = Drawer.EASE(progress) * 2 * Math.PI;
        sample.rotation = rotation;
        sample.x = pos.x + xAnim;
        sample.y = pos.y;
        sample.discovered.alpha = progress;
        sample.undiscovered.alpha = 1 - progress;

      } else if (state.id == STATE_TO_STORAGE) {
        idx = data.storedSamples.indexOf(sample.id);

        pc = scope.pcs[state.player];
        var to1 = {
          x: pc.x + scope.pcOffset.x,
          y: pc.y + scope.pcOffset.y
        };
        var to2 = {
          x: pc.x + scope.pcOffset.x,
          y: pc.y
        };

        if (progress <= 0.5) {
          from = this.getPlayerPosition(data, state.player, scope, progress);
          newPos = lerpPosition(from, to1, unlerp(0, 0.5, progress));
        } else {
          newPos = lerpPosition(to1, to2, unlerp(0.5, 1, progress));
        }

        sample.x = newPos.x;
        sample.y = newPos.y;
        sample.alpha = 1 - unlerp(0.5, 1, progress);
      } else if (state.id == STATE_FROM_STORAGE) {
        idx = data.previous.storedSamples.indexOf(sample.id);

        pos = this.getPlayerPosition(data, state.player, scope, progress);
        pc = scope.pcs[state.player];
        var from1 = {
          x: pc.x + scope.pcOffset.x,
          y: pc.y
        };
        var from2 = {
          x: pc.x + scope.pcOffset.x,
          y: pc.y + scope.pcOffset.y
        };

        if (progress <= 0.5) {
          newPos = lerpPosition(from1, from2, unlerp(0, 0.5, progress));
        } else {
          to = {
            x: pos.x + offset.x,
            y: pos.y + offset.y
          };
          newPos = lerpPosition(from2, to, unlerp(0.5, 1, progress));
        }
        sample.x = newPos.x;
        sample.y = newPos.y;
        sample.alpha = progress;
      } else if (state.id == STATE_STORED) {
        sample.alpha = 0;
      } else if (state.id == STATE_PRODUCE) {
        pos = this.getPlayerPosition(data, state.player, scope, progress);
        from = {
          x: pos.x + prevOffset.x,
          y: pos.y + prevOffset.y
        };
        to = {
          x: map.LABORATORY.source.x,
          y: map.LABORATORY.source.y
        };

        newPos = lerpPosition(from, to, Drawer.ELASTIC(unlerp(0, 0.5, progress)));
        sample.x = newPos.x;
        sample.y = newPos.y;
        fadeP = unlerp(0, 0.6, progress);
        sample.alpha = 1 - fadeP;
      }
    }

  }
};

Drawer.prototype.updatePlayers = function (frame, progress, data, scope) {
  var map = scope.initData.map;
  for (var i = 0; i < data.players.length; ++i) {
    var p = scope.players[i];
    var newPos = this.getPlayerPosition(data, i, scope, progress);
    p.x = newPos.x * scope.gameToView;
    p.y = newPos.y * scope.gameToView;
    p.shadow.x = p.x;
    p.shadow.y = p.y;
  }

};

Drawer.prototype.getPlayerPosition = function (frame, idx, scope, progress) {
  var viewIdx = scope.playerInfo[idx].index;
  var map = scope.initData.map;
  var state = frame.players[idx];
  var to = map[state.target][viewIdx];
  var from = map[state.from][viewIdx];

  var newPos = to;
  if (state.moved) {
    newPos = lerpPosition(from, to, state.total === 0 ? 1 : unlerp(state.total, 0, state.eta + 1 - progress));
  }
  return newPos;
};

