Drawer.prototype.createEndScene = function (scope, lastFrame) {

  var layer = new PIXI.Container();

  var background = new PIXI.Graphics();
  background.beginFill(0, 0.85);
  background.drawRect(0, 0, Drawer.WIDTH, Drawer.HEIGHT);
  background.endFill();

  layer.backgroundRanking = background;


  var titleRanking = new PIXI.Sprite.fromFrame('LOGO_ROCHE_WHITE_SHADOW');
  titleRanking.anchor.x = titleRanking.anchor.y = 0.5;
  layer.titleRanking = titleRanking;

  titleRanking.position.x = Drawer.WIDTH / 2;
  titleRanking.position.y = 230;

  var podium = [];
  for (var i = 0; i < scope.initData.playerCount; ++i) {
    podium.push({
      score: lastFrame.players[i].score,
      player: scope.playerInfo[i],
      rank: 0
    });
  }
  podium.sort(function (a, b) {
    return b.score - a.score;
  });

  scope.finishers = [];
  var finishers = new PIXI.Container();
  var curRank = 1;
  var elem;
  for (i = 0; i < podium.length; ++i) {
    if (i > 0 && podium[i - 1].score != podium[i].score) {
      curRank++;
    }

    podium[i].rank = curRank;
    elem = this.createFinisher(podium[i], scope);
    finishers.addChild(elem);
    scope.finishers.push(elem);
  }



  scope.finishers[0].position.x = (Drawer.WIDTH - scope.finishers[0].width) / 2;
  scope.finishers[1].position.x = (Drawer.WIDTH - scope.finishers[0].width) / 2;
  scope.finishers[1].position.y = 200;
  finishers.y = 380 + 100;

  layer.addChild(background);
  layer.addChild(titleRanking);
  layer.addChild(finishers);


  layer.visible = false;
  return layer;
};

Drawer.prototype.initEndScene = function (scope, failure) {
  scope.endSceneViewed = false;

  if (scope.end) {
    var end = scope.end;
    end.backgroundRanking.alpha = 0;
    end.titleRanking.scale.x = end.titleRanking.scale.y = 10;
  }
};

Drawer.prototype.destroyEndScene = function (scope) {
  var end = scope.end;
  end.titleRanking.visible = false;
  end.visible = false;
};

Drawer.prototype.renderEndScene = function (scope, step, failure) {
  var i;
  var endOfEnd = 10000;
  if (scope.endTime === 0) {
    this.initEndScene(scope, failure);
  }

  var end = scope.end;
  end.visible = true;

  var backS = 0;
  var backD = 400;
  var backP = unlerp(backS, backS + backD, scope.endTime);
  end.backgroundRanking.alpha = backP * 0.9;

  var logoS = 400;
  var logoD = 600;
  var logoP = unlerp(logoS, logoS + logoD, scope.endTime);
  end.titleRanking.scale.x = end.titleRanking.scale.y = 0.001 + lerp(10, 0.64, logoP);
  end.titleRanking.visible = !!logoP;

  var rankS = 1000;
  var rankD = 300;
  for (i = 0; i < scope.finishers.length; ++i) {
    var p = unlerp(rankS + rankD * i, rankS + rankD * i + rankD, scope.endTime);
    scope.finishers[i].alpha = p;
  }

  var shakeForceMax = 10;
  var strength = 0.4;
  var shakeTime = 0, shakeP = 0;

  if (logoP >= 1) {
    shakeTime = 400;
    shakeP = unlerp(logoS + logoD, logoS + logoD + shakeTime, scope.endTime);
  }

  var shakeForce = shakeP ? lerp(shakeForceMax, 0, unlerp(1 - strength, 1, shakeP)) : 0;
  var shakeX = shakeForce * Math.cos(2 * scope.endTime);
  var shakeY = shakeForce * Math.sin(scope.endTime);

  //  scope.container.x = shakeX;
  //  scope.container.y = shakeY;
  //  end.backgroundRanking.x = shakeX - 20;
  //  end.backgroundRanking.y = shakeY - 20;

  scope.endTime += step;

  if (scope.endTime >= endOfEnd && !scope.endSceneViewed) {
    if (this.endCallback) {
      this.endCallback();
    }
    scope.endSceneViewed = true;
  }
};

Drawer.prototype.renderRenderables = function (step, scope) {
  var next = [];
  for (var i = 0; i < scope.renderables.length; ++i) {
    var updatable = scope.renderables[i];
    var remove = updatable.render(step, scope);
    if (!remove) {
      next.push(updatable);
    }
  }
  scope.renderables = next;
};

/** Mandatory */
Drawer.prototype.renderScene = function (scope, question, frames, frameNumber, progress, speed, reason, step, demo) {
  /** ************************************* */
  /*        ASYNCHRONOUS                    */
  /** ************************************* */
  step = Math.min(80, step);

  if (!demo) {
    var endFrame = !this.debugMode && (frameNumber == frames.length - 1 && progress == 1);

    if (endFrame) {
      this.renderEndScene(scope, step, (reason != "Win"));
    } else {
      if (scope.endTime > 0) {
        this.destroyEndScene(scope);
      }
      scope.endTime = 0;
    }
  }
  this.renderRenderables(step, scope);

  return true;
};

/**
 * Optional
 */
Drawer.prototype.getFrameSpeed = function (frameNumber, playerSpeed) {
  if (!this.frames) return 1;
  var frame = this.frames[frameNumber];
  if (frame) {
    for (var i = 0; i < frame.events.length; ++i) {
      var ev = frame.events[i];
      if (ev.id == EV_PRODUCE) { return 0.5; }
    }
  }
  return 1;
};

